  KEY `automacao_aep_situac_medida_controle_orga_507ce3f5_fk_automacao` (`medida_controle_organizacional_id`),
  KEY `automacao_aep_situac_perigo_fator_risco_i_cb897930_fk_automacao` (`perigo_fator_risco_id`),
