  CONSTRAINT `automacao_aep_situac_medida_controle_indi_638a41f1_fk_automacao` FOREIGN KEY (`medida_controle_individual_id`) REFERENCES `automacao_aep_medidacontroleindividual` (`id`),
  CONSTRAINT `automacao_aep_situac_medida_controle_orga_507ce3f5_fk_automacao` FOREIGN KEY (`medida_controle_organizacional_id`) REFERENCES `automacao_aep_medidacontroleorganizacional` (`id`),
  CONSTRAINT `automacao_aep_situac_perigo_fator_risco_i_cb897930_fk_automacao` FOREIGN KEY (`perigo_fator_risco_id`) REFERENCES `automacao_aep_fonteriscoergonomico` (`id`),
  CONSTRAINT `automacao_aep_situac_sugestao_recomendaca_ae13c2c4_fk_automacao` FOREIGN KEY (`sugestao_recomendacao_id`) REFERENCES `automacao_aep_sugestaorecomendacao` (`id`),
  CONSTRAINT `automacao_aep_situacaorisco_inquilino_id_fk` FOREIGN KEY (`inquilino_id`) REFERENCES `contas_inquilino` (`id`)
