INSERT INTO `automacao_rel_luminancia_descricao` VALUES (1,'Ambiente possui um acesso de entrada e saída por meio de escada fixa com corrimão. O piso do local é formado por cerâmica em cor clara. As paredes são pintadas em cores variadas e o teto pintado na cor branca.','rel_luminancia/fotos_iluminancia/20241101_123831052_iOS.jpg',1,1),(2,'Ambiente possui um acesso de entrada e saída por meio de escada fixa com corrimão. O piso do local é formado por cerâmica em cor clara. As paredes são pintadas em cores variadas e o teto pintado na cor branca.','rel_luminancia/fotos_iluminancia/20241101_124305303_iOS.jpg',2,1),(3,'Ambiente de trabalho com um acesso de entrada e saída. Piso formado por cimento queimado e pintado na cor cinza. Parede pintada em cor cinza e branco.','rel_luminancia/fotos_iluminancia/20241101_121754904_iOS.jpg',3,1),(4,'Ambiente está localizado na área do SESMT e possui um acesso de entrada e saída. O piso é formado por cerâmica em cor cinza. As paredes e o teto são pintados na cor branca. Há duas janelas que possuem persianas claras que permanecem fechadas.','rel_luminancia/fotos_iluminancia/download.png',4,1),(5,'Ambiente de trabalho com um acesso de entrada e saída. O piso é formado por cimento batido pintado na cor cinza. As paredes e o teto são pintados na cor branca. Há três janelas com folhas de alumínio que permanecem fechadas.','rel_luminancia/fotos_iluminancia/20241108_161211836_iOS.jpg',5,1),(6,'Ambiente possui um acesso de entrada e saída. O piso é formado por cimento queimado. As paredes e o teto são pintados na cor branca, sendo que há','rel_luminancia/fotos_iluminancia/20241108_161910176_iOS.jpg',6,1),(9,'Sala com um acesso de entrada e saída. Piso formado por cimento queimado. Duas paredes em cor cinza claro e uma em cor branca. Uma das paredes é formada por divisória contendo vidro transparente. Ambiente não possui janelas.','rel_luminancia/fotos_iluminancia/sem_imagem.png',9,1),(10,'Ambiente contendo um acesso de entrada e saída. Piso formado por cerâmica em cor clara. Paredes e teto pintados na cor branca. Há uma janela com vidros transparentes que permanece fechada.','rel_luminancia/fotos_iluminancia/20241108_175008701_iOS.jpg',10,1),(11,'Ambiente de trabalho possui um acesso de entrada e saída. O local possui piso em cerâmica com cor clara, paredes e teto pintados na cor branca. Há duas janelas que permanecem mais tempo fechadas.','rel_luminancia/fotos_iluminancia/20241108_175321295_iOS.jpg',11,1),(13,'Ambiente contendo dois acessos de entrada e saída. Piso formado por porcelanato em cor clara. Parede pintada em cor cinza. Teto pintado em cor branca.','rel_luminancia/fotos_iluminancia/20241118_133717281_iOS.jpg',13,1),(14,'Ambiente possui um acesso de entrada e saída. O piso é coberto por carpete em cor cinza claro. Uma das paredes possui janela e outra é pintada na cor cinza, sendo que de as outras demais são formadas por vidros transparentes.','rel_luminancia/fotos_iluminancia/sem_imagem_XwrgrOg.png',14,1),(15,'Ambiente possui um acesso de entrada e saída. parênquiteto pintados na cor branca. iluminação predominantemente artificial.','rel_luminancia/fotos_iluminancia/sem_imagem_7dyLb60.png',15,1),(16,'Sala em alvenaria contendo um acesso para entrada e saída do local. O teto é formado por placas de isopor em cor clara, as paredes são da cor cinza, além de possuir diversas janelas cobertas por cortinas persianas. O piso é forrado por carpete na cor cinza. O local possui diversas mesas com divisórias entre os postos de trabalho.','rel_luminancia/fotos_iluminancia/20241011_123031466_iOS.jpg',16,1),(17,'Ambiente está localizado dentro do escritório administrativo. Três das quatro paredes são formadas por vidros transparentes. O local possui um acesso de entrada e saída. O piso é formado por carpete em cor cinza claro.','rel_luminancia/fotos_iluminancia/20241011_131820943_iOS.jpg',17,1),(18,'Sala em alvenaria contendo um acesso para entrada e saída do local. O teto e as paredes são pintadas na 